import React from 'react';
import Style from './Home.module.scss';
import classNames from 'classnames';
import  {info} from '../Info/Info';

export default function Home() {
    const firstNameStyle = {
        background: info.gradient,
        WebkitBackgroundClip: "text",
        WebkitTextFillColor: "transparent"
    }

    let bio = info.miniBio;

    function createList() {
        let results = [];
        for(let i = 0; i < bio.length; i ++) {
            let value = bio[i];
            results.push(
                <li><span aria-label="emoji" role="img" className={Style.emoji}>{value[0]}</span> {value[1]}</li>
            )
        }
        return results;
    }

    let socials = info.socials;

    function socialList() {
        let results = [];
        for(let i = 0; i < socials.length; i ++) {
            let value = socials[i];
            results.push(
                <a href={value[0]}>{value[1]}</a>
            )
        }
        return results
    }

    return (
        <main>
            <img src={info.selfPortrait} alt="self" className={classNames(Style.avatar, Style.shadowed)} style={{background:info.gradient}}/>
            <div className={Style.mainText}>
                <h1>Hi, I'm <span style={firstNameStyle}>{info.firstName}</span> üëãüèª</h1>
                <h2>I'm a {info.position}.</h2>
                <ul>
                    {createList()}
                </ul>
                <div className={Style.socials}>
                    {socialList()}
                    {/*<a href="https://twitter.com/paytontjewell"><i className="fa fa-twitter" aria-hidden="true" /></a>*/}
                </div>
            </div>
        </main>
    )
}
